import React from "react";


const Repositories = props => (
    <React.Fragment>
    { props.repositories.map((repository , index) => {
        console.log(repository.owner)
        //const url = `https://api.github.com/repos/${user}/${repo.name}/commits`
        return (
            <React.Fragment key= { index }>
                <p> { repository.name }</p>

                <a href= { repository.html_url } >See on Github</a>
            </React.Fragment>
        )
    })
    }
    </React.Fragment>
)


export default Repositories
